import React from 'react';
import './navbar.css';
import logo from '../../assests/Images/logo.jpeg'

const Navbar=()=> {
  return (
    <nav>
      <img className='navleft' src={logo} alt="" />
      <div className='navcenter'>
        <ul className="navbar">
          <li className="navitems">Home</li>
          <li className="navitems">About</li>
          <li className="navitems">Portfolio</li>
          <li className="navitems">Clients</li>
          <button class="navright ">
       contact me

      </button>
        </ul>


      </div>


    </nav>
  )
}

export default Navbar;
